    Use a stack to track the current state of the accordion. 
    """
    stack = []
    for c in stdin:
        if c == '}' and stack and stack[-1] == '{':
            stack.pop()
        elif c == ']' and stack and stack[-1] == '[':
            stack.pop()
        elif c == ':' and stack and stack[-1] == ':':
            stack.pop()
        else:
            stack.append(c)
    return ''.join(stack) if stack else '-1'

def solution(stdin: str) -> str:
    """
    Return an accordion from the input string or -1 if it cannot be done.

    >>> solution(':|:')
    4
    >>> solution('|||:')
    6
    >>> solution('[]')
    -1
    """
    if not stdin:
        return -1
    chars = {')': '(', '}': '{', ']': '['}
    stack = []
    for c in stdin:
        if c in chars.keys():
            if not stack or stack.pop()!= chars[c]:
                return -1
        else:
            stack.append(c)
    return len(stack)

