    for i in range(4):
        if board[0][i]!= 'x' and board[0][i]!= 'o':
            raise ValueError('invalid sign')

    # check diagonal
    if board[0][0]!= board[1][1] and board[1][1]!= board[2][2] and board[2][2]!= board[3][3]:
        raise ValueError('invalid sign')

    # check reverse diagonal
    if board[0][3]!= board[1][2] and board[1][2]!= board[2][1] and board[2][1]!= board[3][0]:
        raise ValueError('invalid sign')

    # check rows
    for row in board:
        x_count, o_count = row.count('x'), row.count('o')
        if x_count == 3:
            return 'YES'
        if o_count == 3:
            return 'NO'

    # check columns
    for i in range(4):
        x_count, o_count = 0, 0
        for row in board:
            if row[i] == 'x':
                x_count += 1
            elif row[i] == 'o':
                o_count += 1
        if x_count == 3:
            return 'YES'
        if o_count == 3:
            return 'NO'

    # check diagonal
    x_count, o_count = 0, 0
    for i in range(4):
        if board[i][i] == 'x':
            x_count += 1
        elif board[i][i] == 'o':
            o_count += 1
    if x_count == 3:
        return 'YES'
    if o_count == 3:
        return 'NO'

    # check reverse diagonal
    x_count, o_count = 0, 0
    for i in range(3, -1, -1):
        if board[i][i] == 'x':
            x_count += 1
        elif board[i][i] == 'o':
            o_count += 1
    if x_count == 3:
        return 'YES'
    if o_count == 3:
        return 'NO'

    # check whether the board is full
    for row in board:
        for sign in row:
            if sign == '.':
                return 'NO'

    # neither player can win
    return 'YES'

