    """
    This is a classic graph search problem. We will use a Breadth-First-Search to
    find the shortest path from the starting point to the ending point.

    We need to consider the node, x, as well as the node, y, as well as the node,
    z, as the destination.
    """
    starting_point, ending_point = [int(n) for n in stdin.split()]
    steps = [0] * (ending_point + 1)
    queues = [[starting_point]]

    while queues:
        nodes = queues.pop(0)
        last_node = nodes[-1]
        if last_node == ending_point:
            return steps[ending_point]
        for node in [last_node - 1, last_node + 1]:
            if 0 < node < ending_point + 1:
                if steps[node] == 0:
                    steps[node] = steps[last_node] + 1
                    queues.append(nodes + [node])
                if steps[node] == steps[last_node] + 1:
                    queues.append(nodes + [node])

