class Trie:
    def __init__(self):
        self.root = TrieNode(None)

    def insert(self, word: str):
        node = self.root
        for char in word:
            node = node.children[char]
            node.w += 1
        node.is_last = True

    def has_prefix(self, word: str):
        node = self.root
        for char in word:
            if char not in node.children:
                return False
            node = node.children[char]
        return True

