    # build the graph
    graph = {i: {j: 0 for j in range(N)} for i in range(N)}
    for i in range(N):
        for j in range(N):
            if i == j:
                continue

            w, l = weights[i], lengths[i]
            if i < j:
                w, l = w, l
            if w <= parts[0][1] and l <= parts[0][0]:
                graph[i][j] = parts[0][2]
                graph[j][i] = parts[0][2]

    def sub_part(part: tuple) -> int:
        visited = set()
        sub_part_size = 0
        for i in range(1, len(part) - 1):
            for j in range(i + 1, len(part)):
                if part[i] > parts[0][1] or part[j] > parts[0][1]:
                    break
                visited.add(part[i])
                visited.add(part[j])
                sub_part_size += graph[part[i]][part[j]] + graph[part[j]][part[i]]
        return sub_part_size, len(visited)

    min_sub_part_size, num_visited = float('inf'), 0
    for part in parts:
        sub_part_size, num_visited_in_part = sub_part(part)
        if sub_part_size < min_sub_part_size:
            min_sub_part_size = sub_part_size
            num_visited = num_visited_in_part
        elif sub_part_size == min_sub_part_size and num_visited < num_visited_in_part:
            min_sub_part_size = sub_part_size
            num_visited = num_visited_in_part

    if num_visited < N:
        return -1
    return min_sub_part_size

