            return False

    def check_for_safe(i, j):
        if i - 1 >= 0:
            dfs(i - 1, j)

        if i + 1 < n:
            dfs(i + 1, j)

        if j - 1 >= 0:
            dfs(i, j - 1)

        if j + 1 < n:
            dfs(i, j + 1)

    for _ in range(c):
        check_for_safe(x - 1, y - 1)

    return str(sum([1 for row in visited for val in row if val]))


