    n, k = [int(x) for x in stdin.split()]

    if k > n * (n - 1):
        return -1

    def height(i: int) -> int:
        h = 0
        for j in range(2 * n + 1):
            if (i & (1 << j)) and (j % 2 == 0):
                h += 1
        return h

    def area(i: int) -> int:
        return height(i) * (n - height(i))

    lo = 0
    hi = max(area(x) for x in range(2 ** n))
    while lo < hi:
        mid = (lo + hi) // 2
        if area(mid) <= k:
            lo = mid + 1
        else:
            hi = mid

    return lo

