                neighbor_path = current_path + [neighbor[0]]
                neighbor_cost = current_cost + [current_path[-1] + neighbor[1]]
                queue.append((neighbor[0], neighbor_path, neighbor_cost))
    if best_score > P:
        return str(-1)
