            [0, 0],
            [0, 1],
            [1, 0],
            [1, 1],
            [2, 0],
            [2, 1],
            [2, 2],
            [3, 0],
            [3, 1],
            [3, 2]
        ]

        for h_, l_ in cubes:
            if l_ > l or h_ > h:
                continue
            if (i, j) == (l_, h_):
                return recurse(i+1, j, h, l, r) + recurse(i, j+1, h, l, r) + recurse(i+1, j+1, h, l, r)

        return recurse(i+1, j, h, l, r) + recurse(i, j+1, h, l, r)

    return str(recurse(0, 0, l, l, r))

