    # rows
    row_count = board_len // row_len
    # last row
    last_row = board_len % row_len
    # diagonals
    diagonals = ((-1,-1),(-1,1),(1,-1),(1,1))

    # heuristic
    def heuristic(board_start_pos, board):

        if board_start_pos == (0,0):
            return board[0][0]

        if board_start_pos == (board_len - 1, board_len - 1):
            return board[board_len - 1][board_len - 1]

        pawns = []
        for row in range(board_len):
            for col in range(board_len):
                if board[row][col] == 'B':
                    pawns.append((row,col))

        # filter out black pawns
        pawns = filter(lambda x: board[x[0]][x[1]] == 'B', pawns)

        # calculate heuristic score
        score = 0
        for pawn in pawns:
            row = pawn[0]
            col = pawn[1]

            for d_row, d_col in diagonals:
                tmp_row = row + d_row
                tmp_col = col + d_col
                if tmp_row < 0 or tmp_col < 0 or tmp_row >= board_len or tmp_col >= board_len:
                    continue
                if board[tmp_row][tmp_col] == 'B':
                    score += 1
                    break
        return score

    # get initial board position
    pawns = []
    for row in range(row_count):
        for col in range(row_len):
            if board[row][col] == 'B':
                pawns.append((row,col))

    # pick the one with the best heuristic value
    pawns = sorted(pawns, key=lambda x: heuristic(x, board), reverse=True)
    if pawns[0][1] < pawns[1][1]:
        return 'A'
