        while cursor > 0:
            if cbs[cursor] == "(":
                return cursor
            cursor -= 1
        return cursor

    def delete_bracket(cbs, cursor):
        bracket = cbs[cursor]
        cursor += 1
        while cursor < len(cbs):
            if cbs[cursor] == ")":
                return cursor
            cursor += 1
        return cursor

    def delete_after_bracket(cbs, cursor):
        bracket = cbs[cursor]
        cursor += 1
        while cursor < len(cbs):
            if cbs[cursor] == "(":
                return cursor
            cursor += 1
        return cursor

    cursor = 0
