def solution(stdin: str) -> str:
    n = int(stdin)
    if n < 10:
        return str(n)
    # We have to find the minimal number of different digits in all possible partitions of the number $n$
    # In this program, we are given the number of partitions of $n$ into non-zero digits.
    # When we find the number of different digits in a partition, we can find the number of non-zero digits by
    # subtracting from the number of partitions of the number of different digits.
    # This can be done easily by recursion and memoization.
    def dp(n: int, count: int) -> int:
        if n == 0:
            return count
        if count == 0:
            return 0
        if dp(n - 1, count) + 1 < count:
            return dp(n - 1, count) + 1
        return count
    return ''.join(str(dp(n, i)) for i in range(1, 10))

