    for i in range(1, n):
        graph[i] = []

    for _ in range(d):
        v1, v2 = [int(i) for i in stdin.split()]
        graph[v1].append(v2)
        graph[v2].append(v1)

    # dfs to find a vertex with the largest height
    curr = [1, 0]
    stack = [curr]
    height = [0]
    while stack:
        curr = stack[-1]
        if curr[1] == h:
            break
        if not graph[curr[0]]:
            height[0] = max(height[0], curr[1])
            stack.pop()
        else:
            next = graph[curr[0]][0]
            graph[curr[0]].remove(next)
            stack.append([next, curr[1] + 1])

    # find the smallest height and keep the path
    res = []
    stack = [curr]
    while stack:
        curr = stack[-1]
        if curr[1] == h:
            res.append(stack.pop())
        elif not graph[curr[0]]:
            stack.pop()
        else:
            next = graph[curr[0]][0]
            graph[curr[0]].remove(next)
            stack.append([next, curr[1] + 1])

    # print the result
    if res:
