    def dfs(row: int, column: int) -> int:
        nonlocal cells
        if row < 0 or row >= rows or column < 0 or column >= cols:
            return 0
        if cake[row][column] == 'S':
            cake[row][column] = '.'
            return 1 + dfs(row - 1, column) + dfs(row, column - 1) + dfs(row + 1, column) + dfs(row, column + 1)
        return 0

    for row in range(rows):
        for column in range(cols):
            if cake[row][column] == 'S':
                cells = max(cells, dfs(row, column))
    return cells

